AO_1572:"\u0394\u03b5\u03bd \u03c5\u03c0\u03ac\u03c1\u03c7\u03b5\u03b9 \u03b1\u03c1\u03ba\u03b5\u03c4\u03ae \u03b4\u03b9\u03b1\u03ba\u03cd\u03bc\u03b1\u03bd\u03c3\u03b7 \u03c3\u03c4\u03b9\u03c2 \u03c3\u03b7\u03bc\u03b5\u03b9\u03b1\u03ba\u03ad\u03c2 \u03c4\u03bf\u03c0\u03bf\u03b8\u03b5\u03c3\u03af\u03b5\u03c2 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c5\u03c0\u03bf\u03bb\u03bf\u03b3\u03b9\u03c3\u03c4\u03bf\u03cd\u03bd hot \u03ba\u03b1\u03b9 cold spots. \u03a4\u03b1 \u03c3\u03b7\u03bc\u03b5\u03af\u03b1 \u03c3\u03cd\u03bc\u03c0\u03c4\u03c9\u03c3\u03b7\u03c2, \u03b3\u03b9\u03b1 \u03c0\u03b1\u03c1\u03ac\u03b4\u03b5\u03b9\u03b3\u03bc\u03b1, \u03bc\u03b5\u03b9\u03ce\u03bd\u03bf\u03c5\u03bd \u03c4\u03b7 \u03c7\u03c9\u03c1\u03b9\u03ba\u03ae \u03b4\u03b9\u03b1\u03ba\u03cd\u03bc\u03b1\u03bd\u03c3\u03b7. \u039c\u03c0\u03bf\u03c1\u03b5\u03af\u03c4\u03b5 \u03bd\u03b1 \u03b4\u03bf\u03ba\u03b9\u03bc\u03ac\u03c3\u03b5\u03c4\u03b5 \u03bd\u03b1 \u03b4\u03ce\u03c3\u03b5\u03c4\u03b5 \u03bc\u03b9\u03b1 \u03c0\u03b5\u03c1\u03b9\u03bf\u03c7\u03ae \u03bf\u03c1\u03af\u03c9\u03bd, \u03c0\u03b5\u03c1\u03b9\u03bf\u03c7\u03ad\u03c2 \u03c3\u03c5\u03b3\u03ba\u03ad\u03bd\u03c4\u03c1\u03c9\u03c3\u03b7\u03c2 (\u03c4\u03bf\u03c5\u03bb\u03ac\u03c7\u03b9\u03c3\u03c4\u03bf\u03bd 30) \u03ae \u03ad\u03bd\u03b1 \u03a0\u03b5\u03b4\u03af\u03bf \u03b1\u03bd\u03ac\u03bb\u03c5\u03c3\u03b7\u03c2.",
AO_1573:"\u0394\u03b5\u03bd \u03c5\u03c0\u03ac\u03c1\u03c7\u03b5\u03b9 \u03b1\u03c1\u03ba\u03b5\u03c4\u03ae \u03b4\u03b9\u03b1\u03ba\u03cd\u03bc\u03b1\u03bd\u03c3\u03b7 \u03b1\u03bd\u03ac\u03bc\u03b5\u03c3\u03b1 \u03c3\u03c4\u03b1 \u03c3\u03b7\u03bc\u03b5\u03af\u03b1 \u03b5\u03bd\u03c4\u03cc\u03c2 \u03c4\u03b7\u03c2(\u03c9\u03bd) \u03c0\u03bf\u03bb\u03c5\u03b3\u03c9\u03bd\u03b9\u03ba\u03ae\u03c2(\u03ce\u03bd) \u03c0\u03b5\u03c1\u03b9\u03bf\u03c7\u03ae\u03c2(\u03ce\u03bd) \u03bf\u03c1\u03af\u03bf\u03c5. \u039c\u03c0\u03bf\u03c1\u03b5\u03af\u03c4\u03b5 \u03bd\u03b1 \u03b4\u03bf\u03ba\u03b9\u03bc\u03ac\u03c3\u03b5\u03c4\u03b5 \u03bd\u03b1 \u03bf\u03c1\u03af\u03c3\u03b5\u03c4\u03b5 \u03bc\u03b5\u03b3\u03b1\u03bb\u03cd\u03c4\u03b5\u03c1\u03b1 \u03cc\u03c1\u03b9\u03b1.",
AO_1574:"\u0397 \u03b5\u03c0\u03b9\u03bb\u03bf\u03b3\u03ae \u03b1\u03bd\u03ac\u03bb\u03c5\u03c3\u03b7\u03c2 \u03c0\u03bf\u03c5 \u03b5\u03c0\u03b9\u03bb\u03ad\u03be\u03b1\u03c4\u03b5 \u03b1\u03c0\u03b1\u03b9\u03c4\u03b5\u03af \u03c4\u03b7\u03bd \u03c0\u03b1\u03c1\u03bf\u03c5\u03c3\u03af\u03b1 \u03c4\u03bf\u03c5\u03bb\u03ac\u03c7\u03b9\u03c3\u03c4\u03bf\u03bd ${minNumIncidents} \u03b5\u03bd\u03c4\u03cc\u03c2 \u03c4\u03c9\u03bd \u03c0\u03bf\u03bb\u03c5\u03b3\u03ce\u03bd\u03c9\u03bd \u03c3\u03c5\u03bd\u03ac\u03b8\u03c1\u03bf\u03b9\u03c3\u03b7\u03c2.",
