BD_101019:"\u0388\u03bd\u03b1 \u03ae \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b1 \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03b1 \u03c0\u03b1\u03c1\u03b1\u03bb\u03b5\u03af\u03c6\u03b8\u03b7\u03ba\u03b1\u03bd \u03bb\u03cc\u03b3\u03c9 \u03bc\u03b7\u03b4\u03b5\u03bd\u03b9\u03ba\u03ae\u03c2 \u03c4\u03b9\u03bc\u03ae\u03c2 \u03c3\u03c4\u03bf \u03c0\u03b5\u03b4\u03af\u03bf \u03b1\u03c0\u03cc\u03c3\u03c4\u03b1\u03c3\u03b7\u03c2.",BD_101020:"\u0388\u03bd\u03b1 \u03ae \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b1 \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03b1 \u03c0\u03b1\u03c1\u03b1\u03bb\u03b5\u03af\u03c6\u03b8\u03b7\u03ba\u03b1\u03bd \u03bb\u03cc\u03b3\u03c9 \u03c4\u03b9\u03bc\u03ae\u03c2 NULL \u03ae EMPTY \u03c3\u03c4\u03bf \u03c0\u03b5\u03b4\u03af\u03bf \u03b1\u03c0\u03cc\u03c3\u03c4\u03b1\u03c3\u03b7\u03c2.",
BD_101021:"\u0388\u03bd\u03b1 \u03ae \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b1 \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03b1 \u03c0\u03b1\u03c1\u03b1\u03bb\u03b5\u03af\u03c6\u03b8\u03b7\u03ba\u03b1\u03bd \u03bb\u03cc\u03b3\u03c9 \u03bc\u03b7 \u03ad\u03b3\u03ba\u03c5\u03c1\u03b7\u03c2 \u03c4\u03b9\u03bc\u03ae\u03c2 \u03c3\u03c4\u03bf \u03c0\u03b5\u03b4\u03af\u03bf \u03b1\u03c0\u03cc\u03c3\u03c4\u03b1\u03c3\u03b7\u03c2 \u03b6\u03ce\u03bd\u03b7\u03c2.",BD_101022:"\u0388\u03bd\u03b1 \u03ae \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b1 \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03b1 \u03c0\u03b1\u03c1\u03b1\u03bb\u03b5\u03af\u03c6\u03b8\u03b7\u03ba\u03b1\u03bd \u03bb\u03cc\u03b3\u03c9 \u03bc\u03b7 \u03b3\u03c1\u03b1\u03bc\u03bc\u03b9\u03ba\u03ae\u03c2 \u03c4\u03b9\u03bc\u03ae\u03c2 \u03c3\u03c4\u03bf \u03c0\u03b5\u03b4\u03af\u03bf \u03b1\u03c0\u03cc\u03c3\u03c4\u03b1\u03c3\u03b7\u03c2 \u03b6\u03ce\u03bd\u03b7\u03c2.",
BD_101023:"\u0388\u03bd\u03b1 \u03ae \u03c0\u03b5\u03c1\u03b9\u03c3\u03c3\u03cc\u03c4\u03b5\u03c1\u03b1 \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03b1 \u03c0\u03b1\u03c1\u03b1\u03bb\u03b5\u03af\u03c6\u03b8\u03b7\u03ba\u03b1\u03bd \u03b5\u03c0\u03b5\u03b9\u03b4\u03ae \u03bf \u03c4\u03cd\u03c0\u03bf\u03c2 \u03b1\u03c0\u03cc\u03c3\u03c4\u03b1\u03c3\u03b7\u03c2 \u03b6\u03ce\u03bd\u03b7\u03c2 \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03ad\u03b3\u03ba\u03c5\u03c1\u03bf\u03c2.",BD_101024:"\u03a7\u03c1\u03ae\u03c3\u03b7 \u03b3\u03b5\u03c9\u03b4\u03b1\u03b9\u03c4\u03b9\u03ba\u03ae\u03c2 \u03bc\u03b5\u03b8\u03cc\u03b4\u03bf\u03c5 \u03b3\u03b9\u03b1 \u03c3\u03cd\u03c3\u03c4\u03b7\u03bc\u03b1 \u03b3\u03b5\u03c9\u03b3\u03c1\u03b1\u03c6\u03b9\u03ba\u03ce\u03bd \u03c3\u03c5\u03bd\u03c4\u03b5\u03c4\u03b1\u03b3\u03bc\u03ad\u03bd\u03c9\u03bd.",
BD_101025:"\u039c\u03b7 \u03ad\u03b3\u03ba\u03c5\u03c1\u03b7 \u03ad\u03ba\u03c6\u03c1\u03b1\u03c3\u03b7 \u03b6\u03ce\u03bd\u03b7\u03c2.",BD_101026:"\u0397 \u03c0\u03b1\u03c1\u03ac\u03bc\u03b5\u03c4\u03c1\u03bf\u03c2 '${paramName}' \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03ad\u03b3\u03ba\u03c5\u03c1\u03b7.",BD_101027:"\u03a4\u03bf \u03cc\u03bd\u03bf\u03bc\u03b1 '${outputName}' \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03ad\u03b3\u03ba\u03c5\u03c1\u03bf \u03cc\u03bd\u03bf\u03bc\u03b1 \u03b4\u03b5\u03b4\u03bf\u03bc\u03ad\u03bd\u03c9\u03bd \u03b5\u03be\u03cc\u03b4\u03bf\u03c5.",
BD_101028:"\u039e\u03b5\u03ba\u03b9\u03bd\u03ac \u03bd\u03ad\u03b1 \u03ba\u03b1\u03c4\u03b1\u03bd\u03b5\u03bc\u03b7\u03bc\u03ad\u03bd\u03b7 \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1 \u03bc\u03b5 ${totalTasks} \u03b5\u03c0\u03b9\u03bc\u03ad\u03c1\u03bf\u03c5\u03c2 \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b5\u03c2.",BD_101029:"\u039f\u03bb\u03bf\u03ba\u03bb\u03b7\u03c1\u03ce\u03b8\u03b7\u03ba\u03b1\u03bd ${completedTasks}/${totalTasks} \u03ba\u03b1\u03c4\u03b1\u03bd\u03b5\u03bc\u03b7\u03bc\u03ad\u03bd\u03b5\u03c2 \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b5\u03c2.",
BD_101030:"\u0397 \u03b5\u03ba\u03c4\u03ad\u03bb\u03b5\u03c3\u03b7 \u03c4\u03bf\u03c5 ${toolName} \u03b1\u03c0\u03ad\u03c4\u03c5\u03c7\u03b5. \u0395\u03c0\u03b9\u03ba\u03bf\u03b9\u03bd\u03c9\u03bd\u03ae\u03c3\u03c4\u03b5 \u03bc\u03b5 \u03c4\u03bf \u03b4\u03b9\u03b1\u03c7\u03b5\u03b9\u03c1\u03b9\u03c3\u03c4\u03ae \u03c3\u03b1\u03c2 \u03b1\u03bd\u03b1\u03c6\u03ad\u03c1\u03bf\u03bd\u03c4\u03b1\u03c2 \u03c4\u03bf ID \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1\u03c2 '${jobID}'.",BD_101031:"\u0397 \u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1 \u03b1\u03ba\u03c5\u03c1\u03ce\u03b8\u03b7\u03ba\u03b5.",
BD_101032:"\u0397 \u03c4\u03b9\u03bc\u03ae '${paramValue}' \u03c3\u03c4\u03b7\u03bd \u03c0\u03b1\u03c1\u03ac\u03bc\u03b5\u03c4\u03c1\u03bf '${paramName}' \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03b5\u03bd\u03c4\u03cc\u03c2 \u03c4\u03bf\u03c5 \u03ad\u03b3\u03ba\u03c5\u03c1\u03bf\u03c5 \u03b5\u03cd\u03c1\u03bf\u03c5\u03c2 [${expectedRange}]",BD_101033:"\u0397 \u03c0\u03b1\u03c1\u03ac\u03bc\u03b5\u03c4\u03c1\u03bf\u03c2 '${paramName}' \u03b8\u03b1 \u03c0\u03c1\u03bf\u03b2\u03bb\u03b7\u03b8\u03b5\u03af \u03c3\u03c4\u03b7\u03bd \u03c7\u03c9\u03c1\u03b9\u03ba\u03ae \u03b1\u03bd\u03b1\u03c6\u03bf\u03c1\u03ac \u03b5\u03c0\u03b5\u03be\u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1\u03c2.",
BD_101034:"\u0397 \u03c0\u03b1\u03c1\u03ac\u03bc\u03b5\u03c4\u03c1\u03bf\u03c2 '${paramName}' \u03b4\u03b5\u03bd \u03b4\u03b9\u03b1\u03b8\u03ad\u03c4\u03b5\u03b9 \u03c7\u03c9\u03c1\u03b9\u03ba\u03ae \u03b1\u03bd\u03b1\u03c6\u03bf\u03c1\u03ac \u03ba\u03b1\u03b9 \u03b4\u03b5\u03bd \u03ae\u03c4\u03b1\u03bd \u03b4\u03c5\u03bd\u03b1\u03c4\u03ae \u03b7 \u03c0\u03c1\u03bf\u03b2\u03bf\u03bb\u03ae \u03c4\u03b7\u03c2 \u03c3\u03c4\u03b7 \u03c7\u03c9\u03c1\u03b9\u03ba\u03ae \u03b1\u03bd\u03b1\u03c6\u03bf\u03c1\u03ac \u03b5\u03c0\u03b5\u03be\u03b5\u03c1\u03b3\u03b1\u03c3\u03af\u03b1\u03c2.",
BD_101035:"\u0397 \u03c0\u03b1\u03c1\u03ac\u03bc\u03b5\u03c4\u03c1\u03bf\u03c2 '${paramName}' \u03b8\u03b1 \u03c0\u03b5\u03c1\u03b9\u03bf\u03c1\u03b9\u03c3\u03c4\u03b5\u03af \u03c3\u03c4\u03b7\u03bd \u03ad\u03ba\u03c4\u03b1\u03c3\u03b7 \u03b5\u03be\u03cc\u03b4\u03bf\u03c5.",BD_101036:"\u03a4\u03bf \u03c3\u03c4\u03b1\u03c4\u03b9\u03c3\u03c4\u03b9\u03ba\u03cc \u03c3\u03c4\u03bf\u03b9\u03c7\u03b5\u03af\u03bf '${statistic}' \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03ad\u03b3\u03ba\u03c5\u03c1\u03bf \u03b3\u03b9\u03b1 \u03c4\u03bf \u03c0\u03b5\u03b4\u03af\u03bf '${fieldName}'.",
