BD_101090:"\u0397 \u03b3\u03b5\u03c9\u03ba\u03c9\u03b4\u03b9\u03ba\u03bf\u03c0\u03bf\u03af\u03b7\u03c3\u03b7 \u03bf\u03c1\u03b9\u03c3\u03bc\u03ad\u03bd\u03c9\u03bd \u03b5\u03b3\u03b3\u03c1\u03b1\u03c6\u03ce\u03bd \u03b1\u03c0\u03ad\u03c4\u03c5\u03c7\u03b5 \u03ba\u03b1\u03b9 \u03bf\u03b9 \u03b3\u03b5\u03c9\u03bc\u03b5\u03c4\u03c1\u03b9\u03ba\u03bf\u03af \u03c4\u03bf\u03c5\u03c2 \u03c4\u03cd\u03c0\u03bf\u03b9 \u03b5\u03af\u03bd\u03b1\u03b9 \u03b5\u03bb\u03bb\u03b9\u03c0\u03b5\u03af\u03c2.",BD_101091:"\u03a4\u03bf ArcGIS Online World Geocoding Service \u03b4\u03b5\u03bd \u03b5\u03af\u03bd\u03b1\u03b9 \u03c5\u03c0\u03bf\u03c3\u03c4\u03b7\u03c1\u03b9\u03b6\u03cc\u03bc\u03b5\u03bd\u03bf \u03b5\u03c1\u03b3\u03b1\u03bb\u03b5\u03af\u03bf \u03b5\u03bd\u03c4\u03bf\u03c0\u03b9\u03c3\u03bc\u03bf\u03cd \u03b3\u03b9\u03b1 \u0395\u03c1\u03b3\u03b1\u03bb\u03b5\u03af\u03b1 GeoAnalytics.",
